const Product = ({post}) => {
  console.log(post);
  return (<div>
    <p className="font-bold">{post.title}</p>
    <p>{post.description}</p>

    <img src={post.image} width={200}/>
    <p>{post.price}</p>
  </div>);
};

export default Product;
